import ItemBg from "../ItemBg/ItemBg"
import './npocatalog.scss'

const NpoCatalog = ({ list }) => {
  document.title = 'Мобильные комплексы НПА "АВТОМЕДКОМПЛЕКС" | Сенатмед'
  return (
    <>
    <ItemBg title='НПА "АВТОМЕДКОМПЛЕКС"' />
    <section className="mobile">
      <div className="container">
        <div className="mobile__inner">
          <ul className="mobile__list mobile">
            {list.map(({ linkItem, img, model }, index) => {
              return(
                <li className="mobile__item" key={index}>
                  <a href={linkItem}>{img}</a>
                  <a href={linkItem}>{model}</a>
                </li>
              )
            })}
          </ul>
        </div>
      </div>
    </section>
    </>
  )
}

export default NpoCatalog
